import { Chart } from "react-google-charts";
const data = [
  ["Task", "Hours per Day"],
  ["Work", 11],
  ["Eat", 2],
  ["Commute", 2],
  ["Watch TV", 2],
  ["Sleep", 7],
];
 const options = {
  title: "My Daily Activities",
};

const Charts = () => {
  return (
    <Chart
      chartType="PieChart"
      data={data}
      options={options}
      width={"30%"}
      height={"400px"}
    />
  )
}
export default Charts
